{"1": {"comment_id": "aphrodite_artist"  "comment_text": "Sarebbe una sensazione indescrivibile svegliarsi ogni giorno in un posto diverso e straniero. Trovarsi ovunque e poter dire un giorno  davanti a chiunque: "qui ho perso il cappotto"; "qui il sole è nato prima  quando la luna ancora dormiva"; "su questo gradino si sono ritrovati due amanti del Medioevo  io invece sono inciampata non vedendolo" - ridendo di ciò.
Mi sarebbe piaciuto anche condividere il risveglio del mattino  il caffé con il viso assopito e le labbra morbide posate sulle mie ancor prima di addormentarle sul bordo della tazzina. Mi sarebbe piaciuto sentire il sapore del miele mentre l'assaporavo sulla sua lingua e averne sempre più voglia; condividere risate e sorrisi  esperienze e drammi che accoltellavano. Mi sarebbe piaciuto dividere con lui non solo il viaggio attorno al mondo  o tra i rifugi italiani  ma stesso il tempo e l'essenza della vita.

